const std = @import("std");
//const input = \\dabAcCaCBAcCcaDA
const input = \\
;

const alphabet = \\abcdefghijklmnopqrstuvwxyz
;

fn toUpper(ascii_char: u8) u8 {
    var result: u8 = ascii_char;
    if (ascii_char >= 97 and ascii_char <= 122) {
        result -= 32;
    }
    return result;
}

fn shouldIgnore(remove: u8, letter: u8) bool {
    return letter == remove or toUpper(letter) == toUpper(remove);
}

pub fn main() anyerror!void {
    var direct_allocator = std.heap.DirectAllocator.init();

    var result = std.ArrayList(u8).init(&direct_allocator.allocator);

    var bestLength: u64 = 9060; 
    for (alphabet) |letter| {
        result.shrink(0);
        var i: u64 = 0;
        while (i < input.len) : (i += 1) {
            if (shouldIgnore(letter, input[i])) {
                continue;
            }

            if (result.len == 0) {
                _ = result.append(input[i]);
                continue;
            }
            var lhs = result.at(result.len - 1);
            var rhs = input[i];
            var lhsUpper = toUpper(lhs);
            var rhsUpper = toUpper(rhs);

            if ((lhs == rhs or lhsUpper != rhsUpper)) {
                _ = result.append(input[i]);
            } else {
                result.shrink(result.len - 1);   
            }
        }

        std.debug.warn("{}\n", result.len);
        if (result.len < bestLength) {
            bestLength = result.len;
        }
    }
    std.debug.warn("len: {}\n", bestLength);
}
